import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import TemplateOne from "./Components/templates/TemplateOne";

function App() {
  const mockData = {
    name: "John Doe",
    role: "Software Engineer",
    summary: "Experienced developer with expertise in React and Node.js.",
    contact: {
      email: "john.doe@example.com",
      phone: "123-456-7890",
      linkedin: "linkedin.com/in/johndoe",
      github: "github.com/johndoe",
    },
    skills: ["JavaScript", "React", "Node.js", "CSS", "HTML"],
    experience: [
      {
        role: "Frontend Developer",
        company: "TechCorp",
        duration: "Jan 2020 - Dec 2022",
        description: "Developed and maintained web applications using React.",
      },
      {
        role: "Backend Developer",
        company: "CodeBase",
        duration: "Jan 2018 - Dec 2019",
        description: "Built RESTful APIs using Node.js and Express.",
      },
    ],
    education: [
      {
        degree: "B.Sc. in Computer Science",
        institution: "XYZ University",
        duration: "2014 - 2018",
      },
    ],
  };

  return (
    <Router>
      <div>
        <Routes>
          <Route path="/" element={<TemplateOne data={mockData} />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
